import React from 'react';
import FormItems from './formitems.js';
import Formitem from './formitem.js'


class Form extends React.Component{
  render() {
    const formComponents = FormItems.map(item =>
        <Formitem
          cName = {item.cName}
          labelfor = {item.labelfor}
          labeltitle = {item.labeltitle}
          inputtype = {item.inputtype}
          inputcName = {item.inputcName}
          placeholder = {item.placeholder}
          name = {item.name}
         />)
    return (
      <form action="#" id="form" className="col-5 mx-auto p-5">
        <h1>Get in touch with us</h1>
        {formComponents}
        <div class="form-group">
          <label for="msg">
            <b>Message:</b>
          </label>
          <textarea className="form-control" rows="5" id="msg"></textarea >
          <input type="submit" value="Submit" />
       </div>
      </form>
    );
  }
}
export default Form
